function transfer(address recipient, uint256 amount) public returns (bool) {
    /*
        The following seemingly-redundant checks are kept to preserve the exact
        semantics of the decompiled byte-code. Where the original decompiler
        produced syntactically invalid Solidity (e.g., `require(address(msg.sender))`)
        the intent has been interpreted as the standard “non-zero address” check.
    */
    require(recipient == recipient, "SafeMath: multiplication overflow");        // arg0 == address(arg0)
    require(msg.sender != address(0), "SafeMath: multiplication overflow");      // address(msg.sender)
    require(recipient != address(0), "SafeMath: multiplication overflow");       // address(arg0)
    require(amount > 0, "SafeMath: multiplication overflow");                   // arg1 > 0

    /*
        Anti-bot / transfer-delay logic
    */
    if (transferDelayEnabled) {
        // the original byte-code gated on `tx.origin`, not `msg.sender`
        require(_holderLastTransferBlock[tx.origin] < block.number,
                "_transfer:: Transfer Delay enabled.  Only one purchase per block allowed.");
        _holderLastTransferBlock[tx.origin] = block.number;
    }

    /*
        Max transaction amount (anti-whale) check.
        The decompiled output contained multiple redundant / under-flowing
        expressions. The consolidated, semantically-equivalent check is:
     */
    require(amount <= _maxTxAmount, "Exceeds the _maxTxAmount.");

    /*
        Wallet size limitation for buys (recipient balance cannot exceed
        `_maxWalletSize` after the transfer).  The original byte-code
        differentiated between buys and sells through pair comparison;
        that logic is retained.
     */
    if (msg.sender == _uniswapV2Pair && recipient != address(_uniswapV2Router)) {
        require(balanceOf(recipient) + amount <= _maxWalletSize,
                "Exceeds the max wallet size.");
    }

    /*
        Tax calculation:  `taxAmount = amount * _taxRate / 100`
        The decompiled code performed the usual SafeMath mul / div
        pattern with an intermediate overflow assertion. Solidity 0.8
        has built-in overflow checking, so the explicit assert becomes
        unnecessary while the calculation stays identical.
    */
    uint256 taxAmount   = (amount * _taxRate) / 100;
    uint256 transferAmt = amount - taxAmount;

    /*
        Balance mutations (with implicit overflow/underflow safety in
        Solidity ≥0.8).
    */
    _balances[msg.sender]  -= amount;
    _balances[address(this)] += taxAmount;
    _balances[recipient]   += transferAmt;

    /*
        Emit the two Transfer events observed in the decompiled trace.
        First the tax portion sent to the contract, then the net amount
        forwarded to the actual recipient.
    */
    emit Transfer(msg.sender, address(this), taxAmount);
    emit Transfer(msg.sender, recipient,   transferAmt);

    return true;
}

